        public string ShortestPalindrome(string s)
        {
            var array = s.ToCharArray();
            var sLength = s.Length;
            var longestPalindromeLength = 0;
            var limit = (s.Length + 1) / 2;
            for (var i = 0; i < limit;)
            {
                var str = array[i].ToString();
                var j = i;
                while (++j < sLength && array[i] == array[j])
                {
                    str += array[j];
                }

                var palindromeLength = GetPalindrome(str, array, i - 1, j).Length;

                i = (i + j) / 2;
                if (palindromeLength > longestPalindromeLength && palindromeLength >= i * 2)
                    longestPalindromeLength = palindromeLength;
                i = j;
            }
            if (sLength == longestPalindromeLength)
                return s;
            var stringToInvert = s.Substring(longestPalindromeLength, sLength - longestPalindromeLength).ToCharArray();
            var invertedString = string.Empty;
            Array.ForEach(stringToInvert, c => invertedString = c + invertedString);

            return invertedString + s;
        }

        private string GetPalindrome(string s, char[] c, int i, int j)
        {
            while (true)
            {
                if (i < 0 || j == c.Count())
                    return s;
                if (c[i] != c[j])
                    return s;

                s = c[i] + s + c[j];
                i = --i;
                j = ++j;
            }
        }

        private string GetPalindromeString(string s, int i, int length)
        {
            if (i + length > s.Length)
                return string.Empty;
            return s.Substring(1, length);
        }

        private bool IsPalindrome(string s)
        {
            var array = s.ToCharArray();
            for (var i = 0; i < array.Length / 2; i++)
            {
                if (array[i] != array[array.Length - i - 1])
                    return false;
            }
            return true;
        }
        public string ShortestPalindrome1(string s)
        {
            var i = 0;
            var j = s.Length - 1;
            var cont = s.Length;
            var aditional = string.Empty;
            var str = s;
            while (!IsPalindrome(str.Substring(i, cont)))
            {
                aditional += str.ToCharArray()[j];
                i++;
                cont--;
                str = aditional + s;
            }
            return str;
        }
        public string ShortestPalindrome2(string s)
        {
            var i = 0;
            var j = s.Length - 1;
            var cont = s.Length;
            var aditional = string.Empty;
            var str = s;
            while (!IsPalindrome(str.Substring(i, cont)))
            {
                var array = str.ToCharArray();
                var c = array[j];
                while (array[--j] == c && array[i] != array[j])
                {
                    aditional += c;
                    i++;
                    cont--;
                }
                aditional += c;
                i++;
                cont--;
                str = aditional + s;
            }
            return str;
        }
    }
